// Part 1
struct Coord: Hashable {
    let row: Int
    let column: Int
    var value: Int { input[row][column] }
    
    func neighbours() -> Set<Coord> {
        Set(arrayLiteral:
            Coord(row: row-1, column: column),
            Coord(row: row+1, column: column),
            Coord(row: row, column: column-1),
            Coord(row: row, column: column+1)
        ).filter { coord in
            coord.row >= 0 && coord.column >= 0 && coord.row < input.count && coord.column < input[0].count
        }
    }
}

let lowPoints = input.enumerated()
    .flatMap { (row, data) in
        (0..<data.count)
            .map { column in Coord(row: row, column: column) }
            .filter { coord in
                coord.neighbours()
                    .map { $0.value }
                    .allSatisfy { neighbourValue in coord.value < neighbourValue }
            }
    }
print("Low points count: \(lowPoints.count)")

// Part 2
func growAsLargeAsPossible(bassin: Set<Coord>) -> Set<Coord> {
    let allNeighboursOfAllCoords = bassin
        .flatMap { coord in
            coord.neighbours()
                .filter { $0.value < 9 }
        }

    let increasedBassin = bassin.union(allNeighboursOfAllCoords)
    if (increasedBassin.count > bassin.count) {
        return growAsLargeAsPossible(bassin: increasedBassin)
    } else {
        // Growth stopped, hit all edges
        return increasedBassin
    }
}

let res = lowPoints
    .map { Set(arrayLiteral: $0) }
    .map(growAsLargeAsPossible)
    .map { $0.count }
    .sorted()
    .reversed()
    .prefix(3)
    .reduce(1, *)
print("Multiplied bassin size: \(res)")
